var app=new Vue({el:"#app",data:{hour:0,minute:0,standard:7.25,result_d:0,result_h:0,result_m:0,seen:false},methods:{gettime:function(){var b=Math.floor(this.hour*60),a=Math.floor(this.minute),e=(b+a)/(this.standard*60),c;var d=this.checkdata();if(!d){return false}this.result_d=Math.floor(e);c=(b+a)-(this.result_d*this.standard*60);this.result_h=Math.floor(c/60);this.result_m=Math.floor(c%60)},checkdata:function(){if(parseInt(this.hour)!=parseFloat(this.hour)||parseInt(this.minute)!=parseFloat(this.minute)){this.result_d=0;this.result_h=0;this.result_m=0;this.seen=true;return false}this.seen=false;return true}}});